package com.hw.java16;

public class fortest1 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		for(int j = 2; j < 10; j++)
		{	
			for(int i = 2; i < 10; i++)
			{
				System.out.print(j+ "*"+ i+ "="+ j*i+ " ");
			}
			System.out.println();
		}
	}

}
